// function that retrieves slices of data required by the DSP process.
static int raw_feature_get_data(size_t offset, size_t length, float *out_ptr) {
    memcpy(out_ptr, input_buff + offset, length * sizeof(float));
    return 0;
}

int main(){
    signal_t signal; // wrapper for data
    ei_impulse_result_t result; // to store inference output, result of classification
    EI_IMPULSE_ERROR res; // return code from inference

    // checking if buffer size is the same as input, the correctness of the transmitted data
    size_t buf_len = sizeof(input_buff) / sizeof(input_buff[0]);
    if (buf_len != EI_CLASSIFIER_DSP_INPUT_FRAME_SIZE) {
        printf("ERROR: The size of the input buffer is not correct.\n");
        printf("Expected %d items, but got %d\n",
               EI_CLASSIFIER_DSP_INPUT_FRAME_SIZE, (int)buf_len);
        return 1;
    }

    // information about data for buffer
    signal.total_length = EI_CLASSIFIER_DSP_INPUT_FRAME_SIZE;
    signal.get_data = &raw_feature_get_data;

    // running classifier itself
    res = run_classifier(&signal, &result, false);

    printf("\nPredictions made by classifier:\n");
    for (size_t ix = 0; ix < EI_CLASSIFIER_LABEL_COUNT; ix++) {
        printf("%s: %.5f\n",
               result.classification[ix].label, // class
               result.classification[ix].value); // probability
    }

    printf("\nTime spent: DSP %d ms, classification %d ms\n",
          result.timing.dsp, result.timing.classification);

    return 0;
}